La Montana Schwarz est une bombe contenant le noir classique BLK, haute pression et équipée d'un astro fat cap. Cette bombe est constituée d'un recyclage de production sur l'année ce qui explique son tarif attractif. Son fonctionnement est identique à une Montana BLK classique sauf sa pression qui est boostée.

Attention les quantités et la disponibilité de ce produit sont limitées, ne tardez pas trop !

